import React from "react";
import { setToggle } from "../../actions";
import { connect } from "react-redux";
import "./Navbar.css";

interface NavbarProps {
  toggleBreadcrumb(): any;
  active: boolean;
}

class Navbar extends React.Component<NavbarProps> {
  render() {
    const { toggleBreadcrumb, active } = this.props;
    return (
      <div className="hero-head">
        <nav className="navbar">
          <div className="navbar-brand">
            <a className="navbar-item">
              <img src={process.env.PUBLIC_URL + "icon.png"} alt="Logo" />
            </a>
          </div>
          <div id="navbarMenuHeroA" className="navbar-menu">
            <div className="navbar-end">
              <div className="navbar-item">
                <nav className="breadcrumb" aria-label="breadcrumbs">
                  <ul>
                    <li
                      className={active ? "is-active" : ""}
                      onClick={toggleBreadcrumb}
                    >
                      <a
                        href="#"
                        style={{
                          color: active ? "ghostwhite" : ""
                        }}
                      >
                        {" "}
                        spreed{" "}
                      </a>
                    </li>
                    <li
                      className={!active ? "is-active" : ""}
                      onClick={toggleBreadcrumb}
                    >
                      <a
                        href="#"
                        style={{
                          color: !active ? "ghostwhite" : ""
                        }}
                      >
                        {" "}
                        text{" "}
                      </a>
                    </li>
                  </ul>
                </nav>
              </div>
            </div>
          </div>
        </nav>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    active: state.toggle.spreed
  };
};

const mapDispatchToProps = dispatch => {
  return {
    toggleBreadcrumb: () => dispatch(setToggle("BREADCRUMB"))
  };
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Navbar);
